import javax.crypto.BadPaddingException;
import javax.crypto.Cipher;
import javax.crypto.IllegalBlockSizeException;
import javax.crypto.NoSuchPaddingException;
import javax.crypto.spec.IvParameterSpec;
import javax.crypto.spec.SecretKeySpec;
import java.io.UnsupportedEncodingException;
import java.security.*;
import java.util.Base64;

public class AesEncrypt {
    private String key = "";
    private String iv = "";

    public AesEncrypt(String key, String iv) throws Exception {
        this.key = key;
        this.iv = iv;
        if (Base64.getDecoder().decode(this.iv).length!= 16) {
            System.out.println(Base64.getDecoder().decode(this.iv).length);
            throw new Exception("Wrong IV input");
        }
        if ("".equals(this.key))
            throw new Exception("Wrong key input");
    }

    public String encryptString(String inputStr) throws NoSuchPaddingException, NoSuchAlgorithmException, IllegalBlockSizeException, BadPaddingException, InvalidAlgorithmParameterException, InvalidKeyException {
        IvParameterSpec iv = new IvParameterSpec(Base64.getDecoder().decode(this.iv));
        Key encryptionKey = new SecretKeySpec(Base64.getDecoder().decode(this.key), "AES");

        byte[] content = null;
        Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
        cipher.init(Cipher.ENCRYPT_MODE, encryptionKey, iv);
        content = cipher.doFinal(inputStr.getBytes());
        String encryptedString = Base64.getEncoder().encodeToString(content);
        return encryptedString;

    }
    public String decryptString(String inputStr) throws NoSuchPaddingException, NoSuchAlgorithmException, InvalidAlgorithmParameterException, InvalidKeyException, IllegalBlockSizeException, BadPaddingException, UnsupportedEncodingException {
        IvParameterSpec iv = new IvParameterSpec(Base64.getDecoder().decode(this.iv));//iv
        Key encryptionKey = new SecretKeySpec(Base64.getDecoder().decode(this.key), "AES");//key

        byte[] content = Base64.getDecoder().decode(inputStr);
        Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
        cipher.init(Cipher.DECRYPT_MODE, encryptionKey, iv);
        content = cipher.doFinal(content);
        String decryptedString = new String(content, "UTF-8");
        return decryptedString;
    }

    public static void main(String[] args) throws InvalidKeyException, NoSuchPaddingException, NoSuchAlgorithmException, InvalidAlgorithmParameterException, IllegalBlockSizeException, BadPaddingException, UnsupportedEncodingException{
        AesEncrypt de;
        String rawstr = "<body><body>";

        rawstr = rawstr.replace("<body>", "");
        // System.out.println(rawstr);
        try {
            de = new AesEncrypt("mwLxtz2rM0DFQnQYBOlY0DXdKz/yyMC+syNXxrPpYmk=", "W3GOHYcmuwPSlg713erzJw=="); // U2FsdGVkX1+6DeNCHp/YuxKjKT2GJwgEfEAKskEsx897/+TioMSaUAB9R6gddgYFV0m2s7AdpFs0uVHkMxmHqg==
            String decryptedxml = de.decryptString(rawstr);
            System.out.println(decryptedxml);
        } catch (Exception e) {
            e.printStackTrace();
        }
        
    }
}
